import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { Navigation, Home, About, Services, Contact, Blog, Postphotography, Footer} from "./components";
import Typesofphoto from "./components/typesofphoto";
import Wintermarketing from "./components/Wintermarketing";
import Easyproductphoto from "./components/Easyproductphoto";
import Topshopify from "./components/Topshopify";
import Videoediting from "./components/Videoediting";
import Softbox from "./components/Softbox";
import Minimizebounce from "./components/Minimizebounce";
import Termsconditions from "./components/Termsconditions";
import Privacypolicy from "./components/Privacypolicy";
import ClothingPhoto from "./components/ClothingPhoto";
import CarPhoto from "./components/CarPhoto";
import ProductReselling from "./components/ProductReselling";
import FoodPhoto from "./components/FoodPhoto";
import InfluenceMarketing from "./components/InfluenceMarketing";
import ScrollToTop from "./components/ScrollToTop";
import Newyear from "./components/Newyear";
import Productphotography from "./components/Productphotography";
function App() {
  return (
    <Router >
    <div className="App">
    <ScrollToTop/>
        <Navigation />
        <Switch>
          <Route path="/"  component={() => <Home />} />
          <Route path="/about"  component={() => <About />} />
          <Route path="/services"  component={() => <Services />} />
          <Route path="/contact"  component={() => <Contact />} />
          <Route path="/blog"  component={() => <Blog />} />
          <Route path="/footer"  component={() => <Footer />} />
          <Route path="/postphotography"  component={() => <Postphotography />} />
          <Route path="/types-of-photography"  component={() => <Typesofphoto />} />
          <Route path="/7-creative-winter-marketing-ideas-for-e-commerce-businesses"  component={() => <Wintermarketing />} />
          <Route path="/easy-product-photography-solutions-for-small-business"  component={() => <Easyproductphoto />} />
          <Route path="/top-shopify-marketing-strategy-for-sellers"  component={() => <Topshopify />} />
          <Route path="/5-interesting-video-editing-facts"  component={() => <Videoediting />} /> 
          <Route path="/minimize-your-bounce-rate"  component={() => <Minimizebounce />} /> 
          <Route path="/how-to-make-a-softbox-for-product-photography"  component={() => <Softbox />} /> 
          <Route path="/terms-and-conditions"  component={() => <Termsconditions />} /> 
          <Route path="/privacy-policy"  component={() => <Privacypolicy />} /> 
          <Route path="/top-new-year-resolution-for-your-online-store"  component={() => <Newyear />} /> 
          <Route path="/product-photography-how-to-take-photos-for-your-e-commerce-business"  component={() => <Productphotography />} /> 
          <Route path="/a-beginners-how-to-guide-for-clothing-photography"  component={() => <ClothingPhoto />} /> 
          <Route path="/car-photography-a-beginners-how-to-guide-and-tips"  component={() => <CarPhoto />} /> 
          <Route path="/product-reselling-photography-why-and-how-to-do-it"  component={() => <ProductReselling />} /> 
          <Route path="/top-8-food-photography-tips-for-beginners"  component={() => <FoodPhoto />} /> 
          <Route path="/influencer-marketing-how-to-find-the-right-one"  component={() => <InfluenceMarketing />} /> 
        </Switch>
        {/* <Footer/> */}
    </div>
    </Router>
  );
}

export default App;
